import React, { useState } from "react";
import {useQuery} from "@apollo/react-hooks";

import 'bootstrap/dist/css/bootstrap.min.css';
import "./../assets/scss/style.scss";

import {ALL_CHARACTERS, FIND_CHARACTER_BY_ID} from "../queries";

export function LastLaunch() {
  const { loading, error, data } = useQuery(ALL_CHARACTERS);
  return (
    <div>
      <h1>Last Launch</h1>
      {loading ? <p>Loading</p> : <p>Timestamp: {data.launch.timestamp}</p>}
    </div>
  );
}

export default function App() {
  const [characters, character, hasNext, after] = useState(0);
  return (
    <div>
      <header>
        <nav className="navbar">
          <span className="navbar-brand"> Ravn Star Wars Registry</span>
        </nav>
      </header>
      <main className="container-fluid">

      </main>
    </div>
  );
}
